import React from 'react';
import "src/styles/priser.css";
import Footer from "src/components/footer.js";

function Header(){
    return <header><h1>Priser pr. 12/03/2023</h1></header>
}

function Article(){

}

function Priser(){
    return <div class="grid" style={{width: "70vw", margin: "auto"}}>
        <Header/>
        <Footer/>
    </div>;
}

export default Priser;
